Create database product_inventory_db;

use product_inventory_db;

Create table products (
Product_ID char(40) unique,
Product_Name char(100) not null,
Product_Category char(100) not null,
Product_Description char(100),
Price decimal (8,5),
Stock_Quantity int,
Warranty_Period int,
Product_Dimensions char(200),
Manufacturing_Date Date,
Expiration_Date Date,
SKU char(100),
Product_Tags char(100),
Color_Size_Variations char(100),
Product_Ratings int
);

describe products;


select * from products;

select sum(price*stock_quantity) as total_inventory_value
from products;

select product_ID,product_Name,product_category,price from products
where price>100;

select * from products
where manufacturing_date>2023-01-01;

select * from products
where year(expiration_date)=2026;

select * from products
order by price desc
limit 5;

SELECT  count(*) AS Count FROM products;

SELECT Color_Size_Variations, count(*) AS Count FROM products
group by Color_Size_Variations;

select * from products
where product_name like'%Headphones%';


select product_name, count(*) as count from products
group by product_name
having count>1;

select product_name,stock_quantity from products
where stock_quantity<20
order by stock_quantity asc;














